import React from 'react'

function FilterProducts() {
  return (
    <div className='filterProducts'>
         <button>All</button>
        <button>Shoes</button>
        <button>Shirts</button>
        <button>Jerseys</button>
        <button>Laptops</button>
    </div>
  )
}

export default FilterProducts
